            "created": 1455651624000, 
            "description": "<p><b>Register on <a href=\"https://www.eventbrite.com/e/website-user-experience-tickets-24242254235\">Eventbrite</a>\u00a0(early registration though next week).</b></p> <p>Google defines User Experience (UX) as \"the overall experience of a person using a product such as a website...especially in terms of how easy or pleasing it is to use\".</p> <p><br/>- Is your website easy and pleasing to use?\u00a0</p> <p>- Are you visitors able to accomplish tasks with ease and leave with a positive experience?\u00a0</p> <p>- What are your options for improving website UX?\u00a0</p> <p>This event will help answer those questions.</p> <p>We will discuss 3 elements of website UX:</p> <p>\u2022\u00a0What makes for good website user experience, including mobile web</p> <p>\u2022\u00a0How to evaluate your website UX and do basic user research</p> <p>\u2022 What changes you can make to your website to enhance usability and UX</p> <p>We begin at 6:30 with wine, beer, soda and light appetizers. Presentation at 7pm.</p> <p><br/>This event is focused on people who manage and build websites, as well as those interested in user experience.</p> <p>If you are interested in sponsorship, contact [masked].</p>", 
